namespace Challenge06
{
    internal class Program
    {
        public static string input = "";

        public static string fourDigit = "";
        public static int count = 0;
        public static int distinctCount = 14;
        static void Main(string[] args)
        {
            Console.WriteLine(CheckPacket(input[0]));
        }

        public static int CheckPacket(char packet) //"c"
        {
            count++;
            input = input.Remove(0, 1);
            fourDigit += packet;

            if(fourDigit.Length == distinctCount + 1)
            {
                fourDigit = fourDigit.Remove(0, 1);
            }
            if(fourDigit.Length == distinctCount)
            {
                int counter = 0;
                foreach (var c in fourDigit)
                {
                    counter += fourDigit.Count(e => e == c);
                }
                if (counter == distinctCount)
                {
                    Console.WriteLine(fourDigit);
                    return count;
                }
                else return CheckPacket(input[0]);

            }
            else
            {
                if (input != "") return CheckPacket(input[0]);
                else return 0;
            }
            
        }
    }
}